import {
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper,
    Typography,
    Button
} from '@mui/material';


function Mines() {
    const [mines, setMines] = useState(null);
    const { t } = useTranslation();
